import React from 'react';
import { Link } from 'react-router-dom';
import './NavBar.css';
import NavBarFunction from './NavbarFunction.js';


function NavBar() {
    return (
        <div className="container">
            <header>
                <nav class="navbar">
                    <div class="hamburger--container">
                        <div class="hamburger--line line--1"></div>
                        <div class="hamburger--line line--2"></div>
                        <div class="hamburger--line line--3"></div>
                    </div>
                    <ul class="ul--navlinks">
                        <li><Link to='/'>Home</Link></li>
                        <li><Link to='/article'>Article</Link></li>
                        <li><Link to='/extracrunch'>ExtraCrunch</Link></li>
                        <li><Link to='/contact'>Contact</Link></li>
                    </ul>
                </nav>
            </header>
        </div>
    )
}

export default NavBar;
